import React from 'react';
import {BrowserRouter,
		Routes,
		Route
		} from "react-router-dom";

import './ItemViewer.css'
import {ItemViewerPage} from './ItemViewerPage'
import {ItemBox} from './ItemBox'

import {Test} from './Test'


export class ItemViewer extends React.Component {
	
	
	
	constructor(props){
		super(props);
		this.state = {
            DataisLoaded: false,
			count: 0,
			n_pages: 0,
			
			
        };
	}
	
	componentDidMount() {

        fetch(this.props.search)
		.then((res) => res.json())
		.then((json) => {
			this.setState({
				DataisLoaded: true,
				count: json.count
			});
		});
		
		
		
	}
	

	
	render(){
		
		
		let n_pages = 2
		
		const pages = [];
		
		for(let i = 1; i <= n_pages; i++){
			let path_str = ""
			
			if (i > 1){
				path_str += i;
			}
			
			let search_arg = this.props.search + "page=" + i;
			

			pages.push(<Route path={path_str} element={<ItemViewerPage search={search_arg}/>} />);
		}
				
		return (	
			<div>

					<Routes>
					
					{pages}
					
					</Routes>

				
			</div>
		);
	}
}
